1471.sql:
SELECT 
    (SELECT COUNT(*) FROM customers WHERE Currency = 'EUR') * 1.0 / 
    (SELECT COUNT(*) FROM customers WHERE Currency = 'CZK') AS ratio_EUR_to_CZK;

640.sql:
SELECT 
    (SELECT COALESCE(SUM(p.ViewCount), 0) FROM posts p JOIN users u ON p.OwnerUserId = u.Id WHERE u.DisplayName = 'Mornington') -
    (SELECT COALESCE(SUM(p.ViewCount), 0) FROM posts p JOIN users u ON p.OwnerUserId = u.Id WHERE u.DisplayName = 'Amos') AS ViewCountDifference;

1039.sql:
SELECT AVG(long_shots) AS average_long_shots
FROM Player_Attributes
WHERE player_api_id = (SELECT player_api_id FROM Player WHERE player_name = 'Ahmed Samir Farag');

86.sql:
SELECT s.District, s.County, s.School, s.AdmLName1, s.AdmLName2, s.AdmLName3
FROM schools s
WHERE s.CharterNum = '40';

680.sql:
SELECT AVG(Score) AS AverageScore
FROM posts
WHERE OwnerUserId = (SELECT Id FROM users WHERE DisplayName = 'Stephen Turner');

742.sql:
SELECT COUNT(*) 
FROM superhero 
WHERE race_id = (SELECT id FROM race WHERE race = 'Vampire');

171.sql:
SELECT 
    (SELECT SUM(A16) FROM district WHERE A3 = 'North Bohemia') - 
    (SELECT SUM(A16) FROM district WHERE A3 = 'East Bohemia') AS crime_difference;

1143.sql:
SELECT MAX(home_team_goal) AS highest_home_score
FROM "Match"
WHERE league_id = (SELECT id FROM "League" WHERE name = 'Netherlands Eredivisie');

1279.sql:
SELECT (COUNT(DISTINCT CASE WHEN l.GOT >= 60 AND p.Diagnosis = 'SLE' THEN l.ID END) * 100.0 / COUNT(DISTINCT CASE WHEN l.GOT >= 60 THEN l.ID END)) AS percentage
FROM Laboratory l
JOIN Patient p ON l.ID = p.ID;

463.sql:
SELECT COUNT(*) AS translation_count
FROM set_translations
WHERE setCode IN (SELECT setCode FROM cards WHERE name = 'Angel of Mercy');

1504.sql:
SELECT AVG(Amount * Price) AS average_total_price
FROM transactions_1k
WHERE strftime('%Y-%m', Date) = '2012-01';

718.sql:
SELECT COUNT(DISTINCT hero_id) 
FROM hero_power 
WHERE power_id = (SELECT id FROM superpower WHERE power_name = 'Super Strength');

400.sql:
SELECT DISTINCT setCode 
FROM set_translations 
WHERE language = 'Spanish';

1072.sql:
SELECT AVG(overall_rating) AS average_overall_rating
FROM Player_Attributes
WHERE player_api_id = (SELECT player_api_id FROM Player WHERE player_name = 'Aaron Doran');

801.sql:
SELECT 
    (SELECT COUNT(*) FROM superhero WHERE gender_id = (SELECT id FROM gender WHERE gender = 'Male')) * 1.0 /
    (SELECT COUNT(*) FROM superhero WHERE gender_id = (SELECT id FROM gender WHERE gender = 'Female')) AS male_to_female_ratio;

